import React from 'react'
import { Navbar } from 'react-bootstrap';

export default function Navbar1() {
    return (
        <Navbar bg='dark' variant="dark" className="justify-content-md-center">
            <Navbar.Brand>
                LyricFinder
            </Navbar.Brand>
        </Navbar>
    )
}
